import React from 'react';
function User(props) {
    
    function handleClick(){
        alert(props.iduser)
    }

    return ( 
        <div style={{display:'flex', alignItems:'center', gap:'15px'}}>
            <p onClick={handleClick}>{props.nameuser}</p>
            <button>Modifier</button> 
            <button>Supprimer</button>
        </div>
        
     );
}

export default User;
